<h1 align="left">whoscb</h1>
<align="left">List of CellBases.
<h2>Syntax</h2>
<p><blockquote><tt>l = whoscb</tt></blockquote>
</p>
<h2>Description</h2>
<p><tt>l = whoscb</tt> returns the list of initialized instances of CellBase.</p>
